import React from "react";
import AddIcon from '@mui/icons-material/Add';
const MyAccordian = ({question, answer})=>{
    return (
        <>
               <div className="main_heading">
                <p><AddIcon/></p>
                <h3>{question}</h3>
               </div>
               <p className="answer_para">{answer}</p> 
        </>
    );
}

export default MyAccordian;
